гипоаллергенный гель для стирки детских вещей из любых тканей, кроме шелка и шерсти;
эффективно справляется с основными загрязнениями и результатами жизнедеятельности малышей, биологически сложными пятнами (соки, фрукты, ягоды, трава, шоколад, кровь);
защищает яркие цвета тканей (содержит цветосберегающий комплекс);
гипоаллергенно, 0% красителей, хлора, фосфатов и агрессивных отдушек.
Описание
Цветосберегающий комплекс — сохраняет яркие цвета детских вещей.
Энзимы - удаляют сложные пятна.


Способ примененияСледовать информации на ярлыках изделий. Цветное белье стирать отдельно от белого при t не более 60ºС, сильнолиняющее белье - не более 30ºС. При наличии пятен перед стиркой налить немного средства на пятно и замочить в растворе средства в теплой воде на 20-30 мин.

