гипоаллергенный продукт для детей с первых дней жизни и людей, склонных к аллергическим реакциям;
удобно дозируется с помощью колпачка-мерника;
с легким приятным ароматом.
Описание
Экстракт алоэ вера обладает смягчающими, увлажняющими и успокаивающими кожу свойствами.
Силикон облегчает глажение, уменьшает количество складок на белье, предохраняет волокна ткани от изнашивания.


Способ примененияДобавить в воду во время последнего полоскания в дозировке: на 10л воды (ручная стирка) -1/2 колпачка (20 мл); на 4-5 кг сухого белья (стиральная машина) - 1 колпачок (45 мл).

